I'm going to guide you through creating a simple Chrome extension that takes screenshots of a webpage and saves them to a local directory. This extension will use the `chrome.tabs.captureVisibleTab` API to take the screenshot and then save it to the local directory using the `chrome.fileSystem` API.

1. **Create a new directory** for your extension and navigate into it.

2. **Create a manifest file**: Create a new file named `manifest.json` and add the following content:

```json
{
  "manifest_version": 2,
  "name": "Screenshot Extension",
  "version": "1.0",
  "description": "Takes screenshots of the current webpage",
  "permissions": ["activeTab", "fileSystem"],
  "background": {
    "scripts": ["background.js"],
    "persistent": false
  },
  "browser_action": {
    "default_icon": "icon.png",
    "default_popup": "popup.html"
  }
}
```

3. **Create a background script**: Create a new file named `background.js` and add the following content:

```javascript
chrome.runtime.onMessage.addListener(function(request, sender, sendResponse) {
  if (request.action === 'captureScreenshot') {
    chrome.tabs.captureVisibleTab(null, {}, function(imageUrl) {
      chrome.fileSystem.chooseEntry({ type: 'saveFile' }, function(writableFileEntry) {
        writableFileEntry.createWriter(function(fileWriter) {
          fileWriter.write(new Blob([imageUrl], { type: 'image/png' }));
        });
      });
    });
  }
});
```

4. **Create a popup**: Create a new file named `popup.html` and add the following content:

```html
<!DOCTYPE html>
<html>
  <head>
    <script src="popup.js"></script>
  </head>
  <body>
    <h1>Screenshot Extension</h1>
    <button id="captureBtn">Capture Screenshot</button>
  </body>
</html>
```

5. **Add functionality to the popup**: Create a new file named `popup.js` and add the following content:

```javascript
document.getElementById('captureBtn').addEventListener('click', function() {
  chrome.runtime.sendMessage({ action: 'captureScreenshot' });
});
```

